def aupto(n):
  alst, used = [1], {1}
  for i in range(2, n+1):
    binprev = bin(alst[-1])[2:]
    binwt = binprev.count("1")
    pow2 = 2**(len(bin(binwt))-2)
    while binwt in used: binwt += pow2
    alst.append(binwt); used.add(binwt)
  return alst    # use alst[n-1] for a(n)
